import React from "react";

function Track() {
    return (
        <div class="Track">
  <div class="Track-information">
  <h3>{this.props.track.name}</h3>
          <p>{this.props.track.artist} | {this.props.track.album}</p>
        </div>
        <button className="Track-action">+ Add to Playlist</button>
</div>
    )
}

export default Track;
